import { HttpClient } from "@angular/common/http";
import { Injectable } from "@angular/core";

import { ActivatedRouteSnapshot, CanActivate, RouterStateSnapshot } from "@angular/router";

@Injectable()
export class BasketIsEmpty implements CanActivate
{
    constructor(
        private http: HttpClient
    ){}
    async canActivate(route: ActivatedRouteSnapshot, state: RouterStateSnapshot): Promise<boolean>
    {
        const that = this;
        function result()
        {
            return new Promise((resolve, reject) => {
                that.http.get("http://localhost:3000/basket/empty", {withCredentials: true}).subscribe((e) => {
                    return e.hasOwnProperty("isNotEmpty") && e["isNotEmpty"]? resolve(true): reject(false);
                });
            });
        };

        await result();
        return true;
    }
};
